import RegistrationForm from "../components/RegistrationForm";

const Register = () => {
  return (
    <div>
      <h1
      style={{ color: '#10561A', margin: '50px', fontWeight:'bold'}}
      >CBO Application</h1>
      <RegistrationForm />
    </div>
  );
};

export default Register;
